import React from 'react';
import './ZoomOutImages.css';

const images = [
  { id: 1, src: 'data:image/jpeg;base64,', alt: 'Image 1' },
  { id: 2, src: 'https://www.theindustry.fashion/wp-content/uploads/2022/10/download-copy-4.jpeg', alt: 'Image 2' },
  { id: 3, src: 'data:image/jpeg;base64,', alt: 'Image 3' },
];

const ZoomOutImages = () => {
  return (
    <div className="zoomout-container">
      {images.map((image, index) => (
        <img
          key={image.id}
          src={image.src}
          alt={image.alt}
          className={`zoomout-image zoomout-delay-${index + 1}`}
        />
      ))}
    </div>
  );
};

export default ZoomOutImages;
